INSERT INTO `notes` VALUES (9,'Update: Current user is now selected by default when creating a project.','2013-02-11 10:06:12',1,8),(10,'All backups are completed except for the XP machine','2013-02-12 11:34:42',16,9),(11,'Waiting on cms directory ','2013-02-21 11:20:23',8,9),(12,'Waiting on ticket for labshare','2013-02-21 11:22:00',21,9),(13,'15+ hours','2013-02-21 12:14:35',3,9),(14,'<ul>\r\n<li>Logging in now redirects to the Dashboard.</li>\r\n<li>The currently logged in user is now displayed in the footer, near the copyright on the bottom right.</li>\r\n<li>Dates are now easier to read.</li>\r\n<li>Users are sent back to Events index page after creating a new event.</li>\r\n<li>Clicking on the Projtrack logo will take users back to the dashboard.</li>\r\n<li>Admin users can now see all items on the Events and Projects pages, and can also select to view events/projects for a specific developer.</li>\r\n</ul>','2013-02-21 15:38:59',1,8),(15,'<ul>\r\n<li>Admin users can now view events on a monthly basis.</li>\r\n<li>Admin users can now update users\' passwords and other information.</li>\r\n<li>Columns in reports now have a more logical order.</li>\r\n</ul>','2013-02-28 11:23:59',1,8),(16,'<b>Completed Updates</b>\r\n<ul>\r\n	<li>Fixed link to dashboard on Projtrack logo.</li>\r\n	<li>Notes now appear in reverse chronological order on project pages.</li>\r\n	<li>Allowed tags in notes: &lt;b>&lt;a>&lt;i>&lt;u>&lt;ul>&lt;li>&lt;ol>&lt;br></li>\r\n	<li>Reports now show a client\'s department as well as the client\'s name.</li>\r\n	<li>Added a link to return to reports index page from a report.</li>\r\n	<li>All users can now edit and delete notes on project pages.</li>\r\n	<li>Fixed dates on project view page.</li>\r\n	<li>Users can now track hours spent on individual projects. Hours also show up on reports page.</li>\r\n	<li>All lists from the data page now appear in alphabetical order.</li>\r\n	<li>Clients are now displayed along with their departments in the create project page.</li>\r\n</ul>\r\n<br />\r\n<b>Upcoming Updates</b>\r\n<ul>\r\n	<li>Project Summary Report</li>\r\n</ul>','2013-02-28 15:13:45',1,8),(17,'change index.html & default.htm pages','2013-03-05 11:54:45',8,9),(18,'Final report: her problem was not solved.','2013-04-04 11:42:32',87,8),(19,'Update after meeting: Waiting on additional files and information on exactly what to keep on the new CMS website. ','2013-04-15 13:29:12',106,9),(20,'<b>Version 2.1</b>\r\n<ul>\r\n	<li>Project page now allows users to select which semester\'s projects to list</li>\r\n	<li>Project page updated with an interactive table to allow users to more easily find/manage their projects</li>\r\n	<li>Selected dates/semesters now effect results of project reports</li>\r\n	<li>Improved style of notes</li>\r\n	<li>Added version number to bottom of pages</li>\r\n	<li>Updated Shortcut icon (favico)</li>\r\n	<li>Updated dashboard to include more interesting statistics</li>\r\n</ul>','2013-06-19 15:30:43',183,8),(21,'Current status:\r\nConversion 99% complete. Waiting to hear back from Baumann with some missing files.','2013-06-20 10:16:34',184,8),(22,'Current status: Conversion complete. Waiting for her to get access from the help desk.','2013-06-20 10:17:04',185,8),(23,'This includes updating the alumni techcon pages with appropriate names; also includes uploading my picture, and adding my bio.','2013-07-09 14:10:04',181,12),(24,'Ran into multiple problems (viewfinity). ','2013-07-16 14:14:07',202,9),(25,'Sent a reminder e-mail to check access & come for training.','2013-07-25 10:41:30',185,8),(26,'Rafting video on YouTube: The rafting video was subjected to copyright claims on YouTube, because of the music. As a result, i had to remove the sound (\"mute the video\") in order for it to be allowed. So, the video works and is on the specified CMS page, but there is no sound. YouTube has the option to add music that is allowed, and it can be done right in the browser. Josh knows how to do it. So, if Conway decides to add music he can sit down with Josh and pick one or whatever.','2013-08-01 10:21:15',206,8),(27,'Website is now being created on the CMS','2013-08-05 10:17:40',193,9),(28,'<b>Version 2.2</b><br />\r\n<ul>\r\n	<li>Ongoing Projects list no longer lists projects marked as \"complete\" (this was a bug)</li>\r\n	<li>Users are now returned to a project\'s page after editing a project, instead of the project list</li>\r\n	<li>Users can now view client pages, which includes a list of projects for a client as well as a place for \"client notes.\" (Client pages are accessible from the Data page as well as individual project pages and the list on the Projects page.</li>\r\n	<li>The site no longer displays \"currently logged in as:\" in the page footer if a user is not logged in.</li>\r\n</ul>','2013-08-23 12:14:42',183,8),(29,'Update admin documentation as changes occur.','2013-10-03 14:19:29',292,8),(30,'Complete for CTLE, to be modified for the \"Learning Commons\"','2013-10-08 11:56:33',239,8),(32,'11 hours','2013-11-07 11:28:00',311,16),(34,'4 Hours','2014-02-06 10:11:07',379,15),(35,'This is a note.','2014-03-14 11:22:05',467,8),(36,'This is another note.','2014-03-14 11:22:14',467,8),(37,'1 hour','2014-09-04 13:42:12',713,14),(38,'Checking for faculty in test courses, researching user progress, etc','2014-09-30 11:43:14',764,11),(39,'*','2014-11-03 11:45:36',791,15),(40,'Accidentally maxed out the number of hours, it should only be 1.','2015-09-10 11:34:24',1071,22),(41,'2 Hours - Clicked \"complete\" before \"set\" accidentally.','2016-06-30 14:51:44',1367,25),(42,'I added a description','2016-11-29 12:17:25',1468,26),(43,'testing','2017-01-18 15:10:36',1540,26);
